import React from "react";

const InputForm = () => {
  return (
    <form>
      <div className="form-container">
        <div className="text-element">
          <label for="item-title">Title</label>
          <input type="text" id="item-title" />
        </div>
        <div className="pprice-element">
          <label for="item-price">Title</label>
          <input type="number" id="item-price" min="1" />
        </div>
        <div className="date-element">
          <label for="date-title">Title</label>
          <input type="date" min="2019-12-01" max="2022-12-01" />
        </div>
        <div className="btn">
          <button type="submit">Submit</button>
        </div>
      </div>
    </form>
  );
};

export default InputForm;
